import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h1>Accueil</h1>
      <p>
        <Link to="/counter">Compteur</Link>
      </p>
      <p>
        <Link to="/advice">Conseils</Link>
      </p>
    </div>
  );
}

export default Home;
